                    finally
                    {
                        errorMask?.PopIndex();
                    }
                    break;
                default:
                    AItemXmlCreateTranslation.FillPublicElementXml(
                        item: item,
                        node: node,
                        name: name,
                        errorMask: errorMask,
                        translationMask: translationMask);
                    break;
            }
        }

    }

